MultiLanguageSpellData['it'][467306] = {name = "Totem Vivaci", additional_info = "[q][ Potenziamento : Sferzata Lavica ha una probabilità di evocare un Totem delle Fiamme che lancia Dardi Roventi, infliggendo (34.5% of Spell power) danni da fuoco a un nemico vicino. Dura 8 sec.\n\n I lanci di Folgore del Gelo potenziati da Tempesta di Grandine, Sferzata Lavica ed Esplosione di Fuoco fanno sì che i Totem delle Fiamme scaglino una Raffica Rovente su massimo 5 nemici vicini, infliggendo (82.8% of Spell power) danni da fuoco /\n\nRigenerazione\nQuando vengono evocati, il Totem della Marea Curativa, il Totem del Flusso Vitale, il Totem del Nubifragio, il Totem della Marea di Mana e il Totem del Collegamento Spirituale lanciano una Catena di Guarigione istantanea e priva di costo al 100% dell'efficacia ]"}
